import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { solid } from "@fortawesome/fontawesome-svg-core/import.macro"; // <-- import styles to be used
//form page
const ListBuild = (props) => {
  const { arr } = props;

  console.log(arr);

  const results = [];

  for (const arr of fullArr) {
  for (const obj of arr) {
      results.push(
        <a
          className="btn btn-dark rounded-pill hoverLink linkDiv"

          href={obj.links}
        >
          <img
            className="rounded-pill bg-light"
            alt="merchandise"
            src={obj.img}
            style={{ height: "120px", width: "120px" }}
          />
          <h3 className="price text-warning" >
            {obj.price}
          </h3>
          <h1 className="text-warning nameTitle">
            {obj.name}
          </h1>
        </a>
      );
    }
  }
console.log(results)


